import React from 'react';
import { CssBaseline, AppBar, Toolbar, Typography, Container } from '@mui/material';
import UserList from './components/UserList';

function App() {
  return (
    <>
      <CssBaseline />
      <AppBar position="static">
        <Toolbar>
          <Typography variant="h6">
            Site Users Directory
          </Typography>
        </Toolbar>
      </AppBar>
      <Container>
        <UserList />
      </Container>
    </>
  );
}

export default App;
